import React from 'react'
import { useAppSelector } from '../../../app/hooks'
import { selectedAllGuides } from '../../guides/allGuidesSlice'
import { GuidesCard } from './GuidesCard';

export const RenderAllGuides = () => {
  const allGuides = useAppSelector(selectedAllGuides);

  return (
    <div>
        {allGuides.map(() => {
          return(
            <GuidesCard fullName={allGuides.fullName}
                        country={allGuides.country}
                        city={allGuides.city}
                        telephon={allGuides.telephon}
                        email={allGuides.email}
                        image={allGuides.image}/>
          )
        })}
    </div>
  )
}
